import React from 'react'

export default function Modal(props) {
    if (!props.open) return null;
    const onClose = () => {
        props.onClose();
    }
  return (
    <>
    <div>{props.children}</div>
    <button onClick={onClose}>Close Modal</button>
    </>)
}
